  false,\n\t\"url\": null,\n\t\"notes\": \"NODC Accession 0116067 includes chemical,
  discrete sample, physical and profile data collected from NATHANIEL B. PALMER in
  the South Pacific Ocean from 1994-02-14 to 1994-04-05 and retrieved during cruise
  NBP-94_2 and Ross_Sea_320619940214. These data include CHLOROFLUOROCARBON-11 (CFC-11),
  CHLOROFLUOROCARBON-113 (CFC-113), CHLOROFLUOROCARBON-12 (CFC-12), DELTA HELIUM-3,
  DISSOLVED OXYGEN, HELIUM, HYDROSTATIC PRESSURE, NEON, SALINITY and WATER TEMPERATURE.
  The instruments used to collect these data include CTD and bottle. These data were
  collected by S Jacobs and W. Smethie of Columbia University; Lamont-Doherty Earth
  Observatory as part of the CLIVAR_Ross_Sea_320619940214 data set.nnThe International
  CLIVAR Global Ocean Carbon and Repeat Hydrography Program carries out a systematic
  and global re-occupation of select WOCE/JGOFS hydrographic sections to quantify
  changes in storage and transport of heat, fresh water, carbon dioxide (CO2), and
  related parameters.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\":
